function test() {
    function f(x) {
        try {
            print(eval(x));
        } catch (e) {
            print(e.name);
        }
    }

    f('0o123');
    f('0o01234567');
    f('0o171615141312131415161716151413121');
    f('0o1716151413121314151617161514131218');
    f('0o1716151413121314151861716151413121');
    f('');
    f('');

    // Also allowed in strict mode.
    f('(function () { "use strict"; return 0o76543210; })()');
}

try {
    test();
} catch (e) {
    print(e.stack || e);
}
